import React, { Component } from 'react';

const UserOutput = (props) => {
        return (
            <div className="UserOutput">
            <p>{props.username}</p>
            <p>{this.state.username}</p>
            <p>second paragraph</p>
            </div> )

};

export default UserOutput;
